en auf Ihrem Facebook-Profil verlinken. Dadurch kann Facebook den Besuch unserer Seiten Ihrem Benutzerkonto zuordnen. Wir weisen darauf hin, dass wir als Anbieter der Seiten keine Kenntnis vom Inhalt der √ºbermittelten Daten sowie deren Nutzung durch Facebook erhalten. Weitere Informationen hierzu finden Sie in der Datenschutzerkl√§rung von facebook unter[nbsp]<a href="http://de-de.facebook.com/policy.php" target="_blank">http://de-de.facebook.com/policy.php</a></p>\n<p>Wenn Sie nicht w√ºnschen, dass Facebook den Besuch unserer Seiten Ihrem Facebook-Nutzerkonto zuordnen kann, loggen Sie sich bitte aus Ihrem Facebook-Benutzerkonto aus.</p>\n<h3>Datenschutzerkl√§rung f√ºr die Nutzung von Google Analytics</h3>\n<p>Diese Website benutzt Google Analytics, einen Webanalysedienst der Google Inc. ("Google"). Google Analytics verwendet sog. "Cookies", Textdateien, die auf Ihrem Computer gespeichert werden und die eine Analyse der Benutzung der Website durch Sie erm√∂glichen. Die durch den Cookie erzeugten Informationen √ºber Ihre Benutzung dieser Website werden in der Regel an einen Server von Google in den USA √ºbertragen und dort gespeichert. Im Falle der Aktivierung der IP-Anonymisierung auf dieser Webseite wird Ihre IP-Adresse von Google jedoch innerhalb von Mitgliedstaaten der Europ√§ischen Union oder in anderen Vertragsstaaten des Abkommens √ºber den Europ√§ischen Wirtschaftsraum zuvor gek√ºrzt.</p>\n<p>Nur in Ausnahmef√§llen wird die volle IP-Adresse an einen Server von Google in den USA √ºbertragen und dort gek√ºrzt. Im Auftrag des Betreibers dieser Website wird Google diese Informationen benutzen, um Ihre Nutzung der Website auszuwerten, um Reports √ºber die Websiteaktivit√§ten zusammenzustellen und um weitere mit der Websitenutzung und der Internetnutzung verbundene Dienstleistungen gegen√ºber dem Websitebetreiber zu erbringen. Die im Rahmen von Google Analytics von Ihrem Browser √ºbermittelte IP-Adresse wird nicht mit anderen Daten von Google zusammengef√ºhrt.</p>\n<p>Sie k√∂nnen die Speicherung der Cookies durch eine entsprechende Einstellung Ihrer Browser-Software verhindern; wir weisen Sie jedoch darauf hin, dass Sie in diesem Fall gegebenenfalls nicht s√§mtliche Funktionen dieser Website vollumf√§nglich werden nutzen k√∂nnen. Sie k√∂nnen dar√ºber hinaus die Erfassung der durch das Cookie erzeugten und auf Ihre Nutzung der Website bezogenen Daten (inkl. Ihrer IP-Adresse) an Google sowie die Verarbeitung dieser Daten durch Google verhindern, indem sie das unter dem folgenden Link verf√ºgbare Browser-Plugin herunterladen und installieren:[nbsp]<a href="http://tools.google.com/dlpage/gaoptout?hl=de">http://tools.google.com/dlpage/gaoptout?hl=de</a>.</p>\n<h3>Datenschutzerkl√§rung f√ºr die Nutzung von Google +1</h3>\n<p>Erfassung und Weitergabe von Informationen:<br>Mithilfe der Google +1-Schaltfl√§che k√∂nnen Sie Informationen weltweit ver√∂ffentlichen. √ºber die Google[nbsp]+1-Schaltfl√§che erhalten Sie und andere Nutzer personalisierte Inhalte von Google und unseren Partnern. Google speichert sowohl die Information, dass Sie f√ºr einen Inhalt +1 gegeben haben, als auch Informationen √ºber die Seite, die Sie beim Klicken auf +1 angesehen haben. Ihre +1 k√∂nnen als Hinweise zusammen mit Ihrem Profilnamen und Ihrem Foto in Google-Diensten, wie etwa in Suchergebnissen oder in Ihrem Google-Profil, oder an anderen Stellen auf Websites und Anzeigen im Internet eingeblendet werden.<br>Google zeichnet Informationen √ºber Ihre +1-Aktivit√§ten auf, um die Google-Dienste f√ºr Sie und andere zu verbessern. Um die Google[nbsp]+1-Schaltfl√§che verwenden zu k√∂nnen, ben√∂tigen Sie ein weltweit sichtbares, √∂ffentliches Google-Profil, das zumindest den f√ºr das Profil gew√§hlten Namen enthalten muss. Dieser Name wird in allen Google-Diensten verwendet. In manchen F√§llen kann dieser Name auch einen anderen Namen ersetzen, den Sie beim Teilen von Inhalten √ºber Ihr Google-Konto verwendet haben. Die Identit√§t Ihres Google-Profils kann Nutzern angezeigt werden, die Ihre E-Mail-Adresse kennen oder √ºber andere identifizierende Informationen von Ihnen verf√ºgen.<br><br>Verwendung der erfassten Informationen:<br>Neben den oben erl√§uterten Verwendungszwecken werden die von Ihnen bereitgestellten Informationen gem√§√ü den geltenden Google-Datenschutzbestimmungen genutzt. Google ver√∂ffentlicht m√∂glicherweise zusammengefasste Statistiken √ºber die +1-Aktivit√§ten der Nutzer bzw. gibt diese an Nutzer und Partner weiter, wie etwa Publisher, Inserenten oder verbundene Websites.</p>\n<h3>Datenschutzerkl√§rung f√ºr die Nutzung von Twitter</h3>\n<p>Auf unseren Seiten sind Funktionen des Dienstes Twitter eingebunden. Diese Funktionen werden angeboten durch die Twitter Inc., Twitter, Inc. 1355 Market St, Suite 900, San Francisco, CA 94103, USA. Durch das Benutzen von Twitter und der Funktion "Re-Tweet" werden die von Ihnen besuchten Webseiten mit Ihrem Twitter-Account verkn√ºpft und anderen Nutzern bekannt gegeben. Dabei werden auch Daten an Twitter √ºbertragen.</p>\n<p>Wir weisen darauf hin, dass wir als Anbieter der Seiten keine Kenntnis vom Inhalt der √ºbermittelten Daten sowie deren Nutzung durch Twitter erhalten. Weitere Informationen hierzu finden Sie in der Datenschutzerkl√§rung von Twitter unter[nbsp]<a href="http://twitter.com/privacy" target="_blank">http://twitter.com/privacy</a>.</p>\n<p>Ihre Datenschutzeinstellungen bei Twitter k√∂nnen Sie in den Konto-Einstellungen unter<a href="http://twitter.com/account/settings" target="_blank">http://twitter.com/account/settings</a>[nbsp]√§ndern.</p>\n<p>Quellenangaben:[nbsp]<a href="http://www.e-recht24.de/artikel/datenschutz/6590-facebook-like-button-datenschutz-disclaimer.html" target="_blank">Facebook-Disclaimer von eRecht24</a>,[nbsp]<a href="http://www.google.com/intl/de/analytics/privacyoverview.html" target="_blank">Datenschutzerkl√§rung Google Analytics</a>,[nbsp]<a href="http://www.google.com/intl/de/+/policy/+1button.html" target="_blank">Datenschutzerkl√§rung f√ºr Google +1</a>,[nbsp]<a href="http://twitter.com/privacy" target="_blank">Twitter Bedingungen</a></p>', '', 0x00000000000000000000000000000000, '', '', '', '', '', '', '', '', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', NULL, '', 0x00000000000000000000000000000000, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', '', '' );
